export default {
  '权限列表': [
    {
      name: "权限名称",
      field: "name",
      type: "text"
    },
    {
      name: "路径",
      field: "path",
      type: "text"
    },
    {
      name: "权限等级",
      field: "level",
      type: "tag",
    }
  ],
  '用户列表': [
    {
      name: "用户名",
      field: "username",
      type: "text"
    },
    {
      name: "角色",
      field: "roleName",
      type: "text"
    },
    {
      name: "状态",
      field: "status",
      type: "switch",
      messageType: "changeStatus",
      axiosType: "editUser"
    },
    {
      name: "操作",
      type: "button",
      field: [
        {
          type: 'primary',
          icon: 'el-icon-edit',
          axiosType: 'editUser'
        },
        {
          type: 'danger',
          icon: 'el-icon-delete',
          axiosType: 'deleteUser'
        }
      ]
    }
  ],
  '角色列表': [
    {
      name: "角色",
      field: "roleName",
      type: "text"
    },
    {
      name: "角色描述",
      field: "roleDescription",
      type: "text"
    },
    {
      name: "操作",
      type: "button",
      field: [
        {
          type: 'primary',
          icon: 'el-icon-edit',
          axiosType: 'editRole'
        },
        {
          type: 'danger',
          icon: 'el-icon-delete',
          axiosType: 'deleteRole'
        }
      ]
    }
  ]
}
